import React from 'react';
import '../styles/dynamicdis.css';
import srd from '../images/stripeng.jpeg';
import srde from '../images/stripede.jpeg';
import apple from '../images/apple.jpeg';
import ap2048 from '../images/apple_width_2048_full_page_true.jpeg';
import app480 from '../images/apple480.jpeg';
function Dynamic() {
    return (
        <div>
            <div className="dis">
                <div className="textbox">
                    <div>
                        https://api.apiflash.com/v1/urltoimage
                </div>
                    <div>?<span className="curl"><b>url=
               <span></span>
                        <span className="blinking-cursor">|</span></b></span></div>
                </div>

            </div >
            <div className="imagedis">
                <div>
                    <img src={srd} alt="The Stripe website rendered using the website screenshot API." class="af-huge-shadow img-responsive" />
                    <img src={srde} alt="The Stripe website in german rendered using the screenshot API." class="af-huge-shadow img-responsive" />
                    <img src={apple} alt="The Apple website rendered by our screenshot API." class="af-huge-shadow img-responsive" />
                    <img alt="Rendering of the Apple website at 500px width by our screenshot API." class="af-huge-shadow img-responsive" />
                    <img alt="The Apple website at 2048px width rendered using the screenshot API." class="af-huge-shadow img-responsive" />
                    <img alt="Full page render of the Apple website at 2048px thanks to ApiFlash screenshot API." class="af-huge-shadow img-responsive" />
                    <img alt="Crisp rendering by the screenshot API of the Adobe website." class="af-huge-shadow img-responsive" />
                </div>
            </div>
        </div>
    )
}
export default Dynamic
